    false,nt"url": null,nt"notes": "This final environmental impact statement
    identifies the purpose and need for a management plan; outlines the legal foundation
    for management of the Rocky Mountain Arsenal National Wildlife Refuge (refuge);
    and describes and evaluates four alternative plans for managing wildlife, habitat,
    wildlife-dependent public uses, cultural resources, infrastructure, operations,
    and transportation. This process has involved the development of a vision and goals
    that meet the legal directives of the U.S. Fish and Wildlife Service (Service) and
    considered stakeholder input.",nt"license_title": "License Not Specified",nt"extras":
